            xs: {
                width: "320px"
            },
            sm: {
                width: "576px",
                fields: "15px"
            },
            md: {
                width: "768px",
                fields: "15px"
            },
            lg: {
                width: "1110px",
                fields: "40px"
            },
        }
    });
    cb();
});

